import React from 'react';

export default function Paged ({vgPerPage, allVideogames, paged}){
    const pageNumbers = []

    for(let i = 0; i <= Math.ceil(allVideogames/vgPerPage); i++){
        pageNumbers.push(i)
    }
    return (
        <nav>
            <ul>
                {pageNumbers && pageNumbers.map(number => (
                    <li key={number}>
                    <a onClick={() => paged(number)}>{number}</a>
                    </li>
                ))}
            </ul>
        </nav>
    )
}
